import React from 'react';
import {StyleSheet, TouchableOpacity, Text} from 'react-native'

function ProfilePostButton(props) {
    return (
        <TouchableOpacity style={styles.buttonI}>
            <Text style={styles.buttonII}>Post</Text>
        </TouchableOpacity>
    );
}

const styles = StyleSheet.create({

    buttonI:{
        position:'absolute',
        bottom: '18%',  
        borderWidth: 1.5,
        borderRadius: 4,
        padding: 0.5,
        backgroundColor:'#dcdcdc',
        borderColor:'white',                                                                                                                                                                                                                                            
    },

    buttonII:{
        borderWidth: 1.3,
        borderRadius: 4,
        padding: 4, 
        borderColor:'#991414',
        textAlign:'center',
        fontSize:16,                                                                                                                                                                                                                                            
    }

});


export default ProfilePostButton;
